package Interviewed;

public class Print1To100 {

	public static void main(String[] args) {

		// TODO Auto-generated method stub
    String a = " ";
    int len = a.length();
    
    while(true) {
    	System.out.println(len);
    	len++;
    	
    	if(len > 'd') {
    		break;
    	}
    }
		
	}

}
